class User {
    constructor(id, username, mail, pw, image, functions, interests) {
      this.id = id;
      this.username = username;
      this.mail = mail;
      this.pw = pw;
      this.image = image
      this.functions = functions;
      this.interests = interests;
    }
  }
  
  export default User;
